import React from 'react'
import styled from 'styled-components'

const Header = () => {
  return (
	<HeaderContainer>
		<Logo>Toggle</Logo>
	</HeaderContainer>
  )
}

const HeaderContainer = styled.header`
	height: 100%;
	width: 90%;
	display: flex;
	justify-content: space-between;
	align-items: center;
	background: #dfe6e9;
	padding: 0px 30px;
	box-shadow: 2px 5px 10px #ffb092;
`;

const Logo = styled.div`
	font-size: 30px;
	font-weight: 600;
	color: #636e72;
`

export default Header
